import React from 'react';
import Nav from './components/Nav';
import './index.css';
import { Route } from 'react-router';
import About from './components/about/About';
import './App.css';
import Footer from './components/footer/Footer';

function App() {
  return (
    <div>
      <Nav />
      <Route path="/about">
        <About />
      </Route>
    </div>
    );
}

export default App;
